import React from 'react'
import { Row, Col} from 'react-bootstrap'
import products from '../products'
export default function HomeScreen() {
  return (
    <>
        <Row>
            {
                products.map(products=>{
                    <Col>
                        <h3>{Products.name}</h3>
                    </Col>
                })
            }
        </Row>
    </>
  )
}
